// src/UploadButton.js
import React from 'react';

function UploadButton({ onClick }) {
    return (
        <button onClick={onClick} style={styles.button}>
            Upload
        </button>
    );
}

const styles = {
    button: {
        marginTop: '1rem',
        padding: '1rem 2rem',
        fontSize: '1rem',
        cursor: 'pointer',
    },
};

export default UploadButton;
